const Home = () => {
  return (
    <main>
      <h1>Welcome</h1>
      <img src="https://via.placeholder.com/960x240" alt="" />
      <p>
      Atom clothes shop offers a wide range of clothing styles which are perfect for every individual. The shop caters to all body types and sizes, ensuring that everyone can find something they love. The quality of the clothes is exceptional, with attention to detail in both the materials and design. With the combination of affordability, quality, and diversity, Atom clothes shop is a must-visit for anyone looking for good clothes that suit their unique style.
      </p>
    </main>
  );
};

export default Home;
